  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Back Bay NWR
  outlines Refuge accomplishments from January through April of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, vegetation control, and prescribed burning. Resource management is
  outlined; topics include commercial fishing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, and
  violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
